    return <SignInModal />;
  };
  return (
    <div id="header">
      <a id="header-logo" href="#default">
        ManagementChuwa
      </a>
      <input id="header-search" placeholder="Search" />
      <button id="header-signIn">Sign In</button>
    </div>
  );
};

export default Header;
